import React from "react";
import '../styles.css';

function TodoSearch() {
    const onSearchValueChange = (event) => {
      console.log(event)
    }
    return (
        <input className="TodoSearch" placeholder="Hola" type="text"
               onChange={onSearchValueChange}/>
    );
}

export { TodoSearch };
